# encoding: utf-8
# 双指针
class Solution:
    def twoSum(self, numbers, target):
        """
        :type numbers: List[int]
        :type target: int
        :rtype: List[int]
        """
        left = 0
        right = len(numbers) - 1
        result = []
        while left < right:
            number_sum = numbers[left] + numbers[right]
            if number_sum > target:
                right -= 1
            elif number_sum < target:
                left += 1
            else:
                return [left + 1, right + 1]


